import logo from './logo.svg';
import './App.css';
import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";
import { useCallback } from "react";

function App() {

  const options = {
    particles: {
      number: {
        value: 100, // Number of particles
      },
      size: {
        value: 3, // Size of particles
      },
      color: {
        value: "#ffffff", // Color of particles
      },
      shape: {
        type: "circle", // Shape of particles (circle, edge, triangle, polygon, etc.)
      },
      opacity: {
        value: 0.7, // Opacity of particles
      },
      move: {
        enable: true,
        speed: 2, // Speed of particle movement
      },
    },
    interactivity: {
      events: {
        onhover: {
          enable: true,
          mode: "repulse", // Interaction mode on hover (grab, bubble, repulse, etc.)
        },
      },
    },
  };
  const particlesInit = useCallback(async (engine) => {
    await loadFull(engine);
  }, []);

  return (
    <div className="App">
      <Particles options={options} init={particlesInit} />
    </div>
  );
